import styled from "styled-components"
import { useHistory } from "react-router"
import logo from "../img/logo.png"

const HeaderBox = styled.header`

.navbar {
  overflow: hidden;
  background-color: #333;
  position: fixed;
  top: 0;
  width: 100%;
}

.navbar a {
  float: left;
  display: block;
  color: #f2f2f2;
  text-align: center;
  padding: 14px 16px;
  text-decoration: none;
  font-size: 17px;
}

.navbar a:hover {
  background: #ddd;
  color: black;
}

.main {
  padding: 16px;
  margin-top: 30px;
  height: 1500px; /* Used in this example to enable scrolling */
}


`


const Header = () => {


    return (
            
            <HeaderBox>
                <div>
                <img src={logo}/> 
                </div>

              
                
                
            </HeaderBox>
        
    )
}

export default Header;
